import React from 'react';
import { Link } from 'react-router-dom';
import MyRouter from './router';
import Navbar from './components/Navbar.js';

function App() {
  return (
    <div>
      <Navbar />
      <nav>
        <Link to="/">Home</Link>
        <Link to="/about-us">About Us</Link>
        <Link to="/contact-us">Contact Us</Link>
      </nav>
      <MyRouter />
    </div>
  );
}

export default App;
